import React, { useEffect } from "react";
import { fetchTeam,deleteTeam } from "../action/index";
import { connect } from "react-redux";
const Team = (props) => {

  useEffect(() => {
    props.fetchTeam();
  }, []);

  return (
    <div>
      {props.t.team.map(ele=>{
        return(
          <div id={ele._id}>
            <p>{ele.title} <button onClick={()=>props.deleteTeam(ele._id)}>Delete</button>
            <button>Add Player</button>
            </p>

          </div>
        )
      })}
    </div>
  );
};

function mapStateToProps(state) {
  console.log(state)
  return {
    t: state.team,
  };
}

export default connect(mapStateToProps, { fetchTeam,deleteTeam })(Team);
